queries.queryString:
$$logsrc
| json "data.type" as type
| where type matches /^(limit_wc|limit_mu|pwd_leak)$/
| timeslice 60 buckets
//| queryStartTime() as starttime
//| queryEndTime() as endtime
//| concat(toString(toLong((endtime - starttime)/60/1000)), "s") as bucket_size
| fillmissing timeslice (1h)
| count by _timeslice, type
| transpose row _timeslice column type as limit_mu, limit_wc, pwd_leak

_sourceCategory=engineering/log-stream-test
| json "data.type", "data.user_agent" as type, user_agent 
| fields type, user_agent 
| where type matches /^(ss)$/ 
|
if (user_agent matches "*Mac OS X*", "macOS",
if (user_agent matches "*Android*", "Android",
if (user_agent matches "*Windows*", "Windows",
if (user_agent matches "*Chrome OS*", "Chrome",
if (user_agent matches "*iOS*", "iOS",
if (user_agent matches "*Ubuntu*", "Ubuntu", "Other")))))) as Platform
| timeslice 60 buckets
| fillmissing timeslice (1h)
| count by _timeslice, Platform 
| transpose row _timeslice column Platform as Android, iOS, macOS, Other, Ubuntu, Windows
